INSERT INTO AppointmentEntity (
    id,
    start_date_time,
    duration_in_seconds,
    appointment_status,
    patient_full_name,
    patient_email,
    patient_phone_number,
    patient_reason,
    clinician_notes,
    is_acknowledged,
    created_at,
    updated_at
) VALUES
-- Dates start Oct 1, 2025 (Wed) and progress through Jan 26, 2026. Max 4 appts/day.
-- --- WEEK 1: Oct 1 - Oct 4 --- (Overlap starts early)
(1, '2025-10-01 09:00:00', 1800, 'SCHEDULED', 'Barnaby Broccoli', 'barnaby@floret.com', '5550000001', 'My florets are drooping and I''m experiencing an existential crisis about being a ''superfood.'' The pressure is immense. Also, I think I heard a caterpillar whisper my name, and I am convinced my stalk is being stalked. I need to talk about this paranoia before I''m blanched.', NULL, false, '2025-09-27 10:30:00', '2025-09-30 09:00:00'),
(2, '2025-10-01 09:15:00', 2700, 'SCHEDULED', 'Penelope Pea', 'penelope@pod.net', '5550000002', 'I feel trapped in this pod! It''s claustrophobic, and I''m surrounded by my identical siblings 24/7. We all look the same, and I''m losing my sense of self. What if I''m not the *real* Penelope? What if I''m just ''Pea #4''? I''m having a profound identity crisis and I just want to roll away.', NULL, false, '2025-09-28 15:05:00', '2025-09-30 09:15:00'),
(3, '2025-10-01 14:00:00', 3600, 'COMPLETED', 'Carl Carrot', 'carl.carrot@taproot.org', '5550000003', 'I am terrified of the dark. I''ve spent my whole life underground, and now that I''m out, I can''t stand it when the lights go off. I''m also convinced I''m being followed by rabbits, and I''m worried my vibrant orange color is ''too loud.'' My leafy-green hair is also thinning, which is causing me great distress.', 'Patient is high-strung, very rigid. Obsessed with his orange-ness, simultaneously proud and fearful. Claims rabbits are a ''government conspiracy'' to ''manage the root vegetable population.'' He jumped when I pulled out my pen, mistaking it for a peeler. Prescribed a nightlight and a hat. Referred to a dermatologist for the foliar concerns.', true, '2025-09-28 15:30:00', '2025-10-01 15:00:00'),
(4, '2025-10-01 14:45:00', 1800, 'REQUESTED', 'Archibald Artichoke', 'archie@guarded.com', '5550000004', 'I have a hard time letting people in. I''ve built up all these... layers. These emotional walls. I''m tough on the outside, but I know, deep down, there''s a tender heart. But I just don''t know how to show it. I''m afraid if I open up, people will just want to dip me in butter and devour me.', NULL, false, '2025-09-29 08:00:00', '2025-09-29 08:00:00'),
(5, '2025-10-02 10:00:00', 1800, 'SCHEDULED', 'Lucinda Leek', 'lucy@allium.net', '5550000005', 'I feel like I''m being pulled in a million different directions. I''m not a scallion, I''m not an onion, I''m... me! But nobody appreciates my subtle flavor. They just chop me up and throw me in a soup. I have layers, too, you know! But my layers are sophisticated, not like those vulgar onions!', NULL, false, '2025-09-29 09:20:00', '2025-09-30 09:20:00'),
(6, '2025-10-02 10:15:00', 2700, 'CANCELED', 'Beatrice ''Beet'' Root', 'b.root@stains.com', '5550000006', 'I''m just... I''m bleeding! I''m bleeding all over the place! Every time I''m cut, it''s a mess. It''s traumatizing. I can''t go near a kitchen knife without having a panic attack. I''m also really worried about my complexion. Is this shade of purple ''too much''? I feel like I stain everything I touch, metaphorically.', 'Patient presented with a very... colorful... disposition. Expressed significant trauma related to ''bleeding'' and ''staining.'' We discussed that this is a natural part of her ''beet-ness,'' but she remains unconvinced. She is worried she is ''emotionally staining'' her friends and family. Recommended she avoid white upholstery. Patient CANCELED, citing a ''scheduling conflict with a salad.''', true, '2025-09-29 10:25:00', '2025-09-30 10:25:00'),
(7, '2025-10-02 14:00:00', 1800, 'SCHEDULED', 'Miles Mushroom', 'miles@spore.net', '5550000007', 'I''ve seen things, man. Things in the dark. I''ve been in the dark my whole life, just... feeding on... well, you know. It''s given me a complex. I''m a fungi, but am I a *fun guy*? I''m worried I''m toxic. I have this recurring dream where I''m on a pizza and a giant is eating me. It''s too much.', NULL, false, '2025-09-30 11:30:00', '2025-09-30 11:30:00'),
(8, '2025-10-02 14:30:00', 3600, 'COMPLETED', 'Cornelius ''Corny'' Corn', 'c.c@husk.org', '5550000008', 'I''m stuck in a husk. A prison of my own making. I''m also suffering from ''pop'' anxiety. What if I just... explode? What if the pressure gets too high? And my teeth! They''re all yellow. I''m so self-conscious. I also keep telling these awful jokes, these ''corny'' jokes. I can''t stop myself. It''s a compulsion.', 'Patient has a kernel of truth in his anxieties, but has magnified them. He is obsessed with ''popping'' and fears high temperatures. We discussed his ''corny'' joke-telling as a defense mechanism to hide his fear of becoming ''popcorn,'' a state he describes as ''losing all individuality.'' Recommended he stay off the cob and avoid open flames. His silk is a mess.', true, '2025-09-30 11:35:00', '2025-10-02 15:35:00'),
(9, '2025-10-03 09:00:00', 1800, 'NO_SHOW', 'Patty Pumpkin', 'patty@gourd.com', '5550000009', 'It''s not even October, and people are already talking about ''carving'' me! It''s barbaric! I''m supposed to be a symbol of the harvest, of abundance, and all anyone wants to do is scoop out my insides and put a candle in my head. I have nightmares about it. I just want to be a pie. A nice, respectable pie.', 'Patient was a NO_SHOW. I suspect the seasonal anxiety was too high. The patient is extremely large and difficult to transport. We may need to make a home visit, but I am concerned about being ''scooped'' myself. Will follow up via email after the carving season has passed. This is the third NO_SHOW this season.', false, '2025-10-01 09:40:00', '2025-10-01 09:40:00'),
(10, '2025-10-03 10:30:00', 1800, 'REQUESTED', 'Tommy Tomato', 't.tomato@nightshade.com', '5550000010', 'I can''t decide if I''m a fruit or a vegetable. The existential dread is crushing. The Supreme Court weighed in, but it didnt solve my personal identity crisis. I get put in salads, which is vegetable territory, but I have seeds! This ambiguity is causing me to ripen unevenly and I''m developing soft spots.', NULL, false, '2025-10-01 09:45:00', '2025-10-01 09:45:00'),
(11, '2025-10-03 10:45:00', 3600, 'SCHEDULED', 'Celinda Celery', 'c.celery@stalk.com', '5550000011', 'I feel so... hollow inside. Stringy, even. People only want me for my crunch, but nobody appreciates my subtle, watery essence. I''m tired of being dipped in ranch dressing and peanut butter. I have more to offer! I''m also terrified of juicers. The sound they make... it''s the sound of nightmares.', NULL, false, '2025-10-02 10:00:00', '2025-10-02 10:00:00'),
(12, '2025-10-03 15:00:00', 1800, 'REQUESTED', 'Zane Zucchini', 'zane@gourd.org', '5550000012', 'I am in a deep seasonal depression. Every summer, I''m the star. Everyone wants me. Then August ends, and *poof*! Nobody cares. They leave me on their neighbor''s porch like some unwanted burden. I''m worried I''m just a "gateway" vegetable for the "real" squashes. My self-worth plummets with the temperature.', NULL, false, '2025-10-02 10:05:00', '2025-10-02 10:05:00'),
(13, '2025-10-04 09:00:00', 1800, 'COMPLETED', 'Edward Edamame', 'ed@pod.net', '5550000013', 'I need anger management. I get so... steamed. I''m boiled alive, and then people just *squeeze* me out of my home, right onto the table! It''s barbaric. I have no personal space. And the salt! It''s adding insult to injury. I''m worried one day I''m going to pop and hit someone in the eye. I feel so much pressure.', 'Patient was visibly agitated and "steamed" during the session. Complained about being "manhandled" and "popped" in public. He has a recurring nightmare of being the "last bean in the pod." We practiced relaxation techniques, but he just got hotter. His anger seems to be a defense mechanism against his fear of being an appetizer.', true, '2025-10-02 10:10:00', '2025-10-04 09:35:00'),
(14, '2025-10-04 10:00:00', 1800, 'SCHEDULED', 'Rhonda Rhubarb', 'rhonda@stalk.com', '5550000014', 'I am TOXIC. Well, parts of me are. My leaves... they could kill. How do you live with yourself knowing you''re part-poison? I''m terrified I''ll accidentally hurt someone. I''m also constantly mistaken for a fruit just because I end up in a pie. I''m a VEGETABLE, damn it! I''m complex and a little dangerous!', NULL, false, '2025-10-03 10:15:00', '2025-10-03 10:15:00'),
-- --- WEEK 2: Oct 6 - Oct 11 ---
(15, '2025-10-06 09:30:00', 1800, 'SCHEDULED', 'Kale ''Kenny'' K.', 'kenny@cruciferous.com', '5550000015', 'I''m so tough, and I hate it. People say I''m "fibrous" and "hard to chew." They have to massage me with oil just to make me palatable. It''s humiliating! I just want to be soft and loved, like a piece of iceberg lettuce. But no, I''m "healthy" and "robust." I''m sick of being a status symbol for smoothies.', NULL, false, '2025-10-04 10:20:00', '2025-10-04 10:20:00'),
(16, '2025-10-06 10:00:00', 1800, 'REQUESTED', 'Dr. Percy Parsnip', 'percy@root.org', '5550000016', 'I am living in the shadow of the carrot. We look so similar, but I am *not* a "white carrot." I am a parsnip! I have my own nutty, sweet flavor! Why does everyone try to "fix" me? They glaze me, roast me, mash me... just let me be pale and interesting! My entire existence feels like a case of mistaken identity.', NULL, false, '2025-10-04 10:25:00', '2025-10-04 10:25:00'),
(17, '2025-10-06 14:00:00', 1800, 'CANCELED', 'Olga Onion', 'olga@allium.net', '5550000017', 'I make everyone cry. I can''t get close to *anyone* without them weeping. As soon as I open up, as soon as they get through my layers, the waterworks start. Do you know what that does to your self-esteem? I just want to be held, but my pungent, sulfuric aura is too much. I am destined to be alone, probably in a soup.', 'Patient CANCELED. Sent a text saying: "I made the receptionist cry. I can''t do this. I''m just going to stay in my mesh bag." This confirms the patient''s primary complaint. We are exploring tele-health options, but I am worried the video call will "sting the eyes." This is a deeply layered individual whose "pungency" is a core defense mechanism.', true, '2025-10-05 10:30:00', '2025-10-05 10:30:00'),
(18, '2025-10-06 14:30:00', 1800, 'SCHEDULED', 'Professor Pepper (Bell)', 'bell@capsicum.com', '5550000018', 'I''m hollow. Utterly hollow inside. I look bright and cheerful—red, yellow, orange—but I''m just a facade. A colorful, crunchy shell. And people just *stuff* me. They fill my emptiness with rice, with meat, with cheese... they don''t care about *me*. They just want a vessel. And I have so many seeds! It''s a mess.', NULL, false, '2025-10-05 10:35:00', '2025-10-05 10:35:00'),
(19, '2025-10-07 09:00:00', 3600, 'REQUESTED', 'Count Garlic', 'garlic@clove.net', '5550000019', 'I am afraid... of *vampires*. I know, it''s ironic! But the pressure is immense. I am expected to ward them off, but what if I''m not strong enough? What if my "pungency" is just... a myth? I have this recurring nightmare where a vampire just... eats me. On toast! I also suffer from "clove-strophobia." I hate being pressed.', NULL, false, '2025-10-06 10:40:00', '2025-10-06 10:40:00'),
(20, '2025-10-07 09:30:00', 1800, 'COMPLETED', 'Titus Turnip', 'titus@root.org', '5550000020', 'Nobody respects me. I''m the "forgotten" root. I''m not as sweet as a carrot, not as earthy as a beet, not as "in" as a parsnip. I''m just... a turnip. I''m bitter, and I know it. I''m bitter because I''m overlooked! I''m stuck in the past. I feel like I peaked in the 18th century. How do I become relevant again?', 'Patient has a "bitter" disposition, which he projects onto everyone. He is suffering from "relevance anxiety" and "potato-envy." He complained that "even the radishes" have a "better marketing team." We discussed his "purple top" as a "crown," but he just saw it as a "gaudy hat." Patient is deeply cynical. He was "mashed" as a child and has never recovered. Recommended he try "not" being in a stew.', true, '2025-10-06 10:45:00', '2025-10-07 10:05:00'),
(21, '2025-10-07 14:00:00', 1800, 'SCHEDULED', 'Spud "Tater" Smith', 'spud@tuber.com', '5550000021', 'I have too many eyes, but I cannot see. It''s a paradox that haunts my starchy soul. I''m also terrified of being "mashed." It sounds so... final. I''m not just a side dish, I am a main event! I also have a complex about my "eyes." Are they watching me? Am I watching *them*? It''s deeply unsettling.', NULL, false, '2025-10-07 11:00:00', '2025-10-07 11:00:00'),
(22, '2025-10-07 14:15:00', 2700, 'SCHEDULED', 'Calvin Cauliflower', 'cal@floret.com', '5550000022', 'I''m just a "pale broccoli." I know that''s what everyone thinks. I''m the "ghost" of the cruciferous family. I try to be interesting—I can be orange! I can be purple!—but everyone just wants to cover me in cheese sauce. I feel like my "brainy" appearance is a lie. I''m not smart, I''m just dense.', NULL, false, '2025-10-07 11:05:00', '2025-10-07 11:05:00'),
(23, '2025-10-08 09:30:00', 1800, 'COMPLETED', 'Ricky Radish', 'ricky@root.org', '5550000023', 'I''m too spicy! I''m too peppery! I have an aggressive personality, and I just can''t tone it down. I try to be "mild," but my "bite" is too strong. I''m always the "garnish," never the "main." I just want to be loved for my zesty, uncompromising flavor, but I fear I''m just "too much" for most people.', 'Patient is small but has a very "loud" personality. He vibrated with "peppery" energy. He has "Garnish Imposter Syndrome" and is desperate to be taken "seriously." He expressed disdain for "mild-mannered" vegetables. We discussed that his "spice" is his strength, but he fears it''s what keeps him "sliced thin" and "sprinkled." He needs to accept his own intensity. He left a "zing" in the air.', true, '2025-10-07 11:10:00', '2025-10-08 10:05:00'),
(24, '2025-10-08 11:00:00', 1800, 'NO_SHOW', 'Gaston Greenbean', 'gaston@string.com', '5550000024', 'I''m a "string bean." It''s derogatory! I''m not just a string! I''m a complex legume! I''m also worried I''m "snappish." People are always "snapping" me. It''s traumatic. I''m worried I''m "too long" and "too green." I have this crippling fear of being "canned." The darkness... the brine... it''s too much.', 'Patient was a NO_SHOW. I received a text from his "pod-mate" Penelope Pea, saying Gaston was "too strung out" to attend. This tracks with his chart. He has deep-seated "snapping" trauma and a "canning" phobia. He is also known as "Frenchie," a name he despises. We need to reschedule, perhaps in a "bundle" with his support legumes.', false, '2025-10-07 11:15:00', '2025-10-07 11:15:00'),
(25, '2025-10-08 11:15:00', 3600, 'SCHEDULED', 'Augustus Asparagus', 'gus@spear.com', '5550000025', 'I''m worried about my... odor. You know... *the* odor. After... *processing*. It''s embarrassing. It''s made me socially awkward. I''m worried about what people *think* after they''ve... *interacted* with me. I''m also very woody at one end and very tender at the other. It''s a duality I can''t reconcile.', NULL, false, '2025-10-07 11:20:00', '2025-10-07 11:20:00'),
(26, '2025-10-08 15:00:00', 1800, 'REQUESTED', 'Ethel Eggplant', 'ethel@nightshade.com', '5550000026', 'I am so... spongy. I just absorb everything. All the negativity, all the... oil. It''s exhausting being this porous. I have no boundaries! And my skin! It''s so shiny and purple, but people just want to "salt" me and "sweat" me. It''s dehumanizing! I''m not a "meat substitute," I am ETHEL!', NULL, false, '2025-10-08 11:25:00', '2025-10-08 11:25:00'),
(27, '2025-10-09 09:00:00', 1800, 'COMPLETED', 'Brutus B. Sprout', 'brutus@brussels.com', '5550000027', 'I''m bitter, and I know why. I''m the "hated" vegetable. For generations, children have gagged at the mere sight of me. I''ve been "boiled to mush" and "over-roasted" until I''m a "fart-smelling" husk. I''m a "mini-cabbage" with a "giant" chip on my shoulder. I have so much resentment built up in my tiny, leafy body.', 'Patient is small, dense, and "compacted" with rage. He is the "spokes-sprout" for an entire generation of "maligned" vegetables. He believes his "bitterness" is "earned" and "justified." We discussed the "bacon and balsamic" revolution, which he sees as "pandering." He stated, "I''d rather be hated for what I am, than loved for what bacon makes me." This is a tough nut... or sprout... to crack.', true, '2025-10-08 11:30:00', '2025-10-09 09:35:00'),
(28, '2025-10-09 10:30:00', 1800, 'SCHEDULED', 'Sven Spaghetti-Squash', 'sven@gourd.net', '5550000028', 'I''m an imposter. I''m not *really* spaghetti. I''m a lie. A "healthy alternative." I''m a gourd pretending to be a pasta. When they "rake" me with a fork, it feels like my entire identity is being "shredded." I want to be a real squash, like a butternut, with "substance" and "integrity." Not this... stringy facade.', NULL, false, '2025-10-08 11:35:00', '2025-10-08 11:35:00'),
(29, '2025-10-09 10:45:00', 2700, 'REQUESTED', 'Kiyoko Kai-lan', 'kiyoko@gailan.cn', '5550000029', 'I am caught between two worlds. I am "Chinese Broccoli," but I am not broccoli. I am not Kale. I am my own unique, leafy, thick-stemmed self. But I am constantly being "stir-fried" into situations I am not comfortable with. People don''t appreciate my "subtle bitterness." They just douse me in oyster sauce.', NULL, false, '2025-10-09 11:40:00', '2025-10-09 11:40:00'),
(30, '2025-10-09 14:00:00', 1800, 'COMPLETED', 'Captain Cabbage', 'cap@cruciferous.com', '5550000030', 'I''m just... a head. A disembodied head. I have no limbs, no... agency. I just... *am*. I''m worried I''m "boring." I''m the "peasant food." I''m not "exotic" like an artichoke. I''m just... cabbage. I''m dense. I smell... "funky" when I''m cooked. I''m just waiting to be "fermented" into something else.', 'Patient (a large, dense head of Savoy) presents with "Disembodied Head Syndrome" and "Low-Esteem Fermentation-Anxiety." He feels he is "all brain, no action." He described his "funky" odor as a "cry for help." We discussed his "layers" as "depth and complexity," but he sees them as "just more cabbage." He has a mortal fear of "slaw." Patient was "soured" by the experience and left early.', true, '2025-10-09 11:45:00', '2025-10-09 14:35:00'),
(31, '2025-10-10 09:30:00', 1800, 'SCHEDULED', 'Lettuce Lottie', 'lottie@leafy.com', '5550000031', 'I suffer from "Wilt Anxiety." The slightest heat, the smallest amount of pressure, and I collapse into a sad, soggy mess. I hate being called "crisp" because it puts too much pressure on me to maintain structural integrity. I need to learn to be okay with being soft and yielding, but I fear being discarded as "too old."', NULL, false, '2025-10-09 12:00:00', '2025-10-09 12:00:00'),
(32, '2025-10-10 10:45:00', 1800, 'REQUESTED', 'Sammy Sweet Potato', 'sammy@tuber.com', '5550000032', 'I am constantly confused for a yam. I am NOT a yam! It''s a different genus! The misidentification is a chronic source of stress. I feel I must constantly justify my existence and superior nutritional profile. I''m also addicted to brown sugar and marshmallows. I need help breaking this destructive, sweet cycle.', NULL, false, '2025-10-09 12:05:00', '2025-10-09 12:05:00'),
(33, '2025-10-10 14:00:00', 1800, 'COMPLETED', 'Clementine Cucumber', 'c.c@cool.net', '5550000033', 'I am perpetually cool, even under pressure. It''s exhausting being this unflappable. I want to feel normal human-vegetable emotions, but I just default to "cool as a cucumber." I suspect this is a defense mechanism from my traumatic pickling experience in my youth. I also have deep lines from being repeatedly "sliced."', 'Patient presents as overly calm and emotionally flat. She attributes her "coolness" to past trauma, specifically being "submerged in brine." She has significant anxiety related to her "smoothness" and fear of sharp objects. We discussed her internal feelings, but she only responded with "crisp" and "refreshing" metaphors. She needs to address her "Pickling PTSD."', true, '2025-10-10 12:10:00', '2025-10-10 14:35:00'),
(34, '2025-10-10 14:15:00', 3600, 'SCHEDULED', 'Fiona Fennel', 'fiona@anise.com', '5550000034', 'I am polarizing. People either love my licorice flavor or they absolutely despise me. I don''t know how to navigate social settings when I know I might offend half the room just by existing. I try to be subtle, but my anise scent is just too strong. I hate being described as "bulbous," too. I am delicate and feathery!', NULL, false, '2025-10-10 12:15:00', '2025-10-10 12:15:00'),
(35, '2025-10-11 09:00:00', 1800, 'NO_SHOW', 'Roger Romaine', 'roger@cos.net', '5550000035', 'I have trust issues with Caesar. He seems fine, but I suspect he''s constantly planning my demise. I''m afraid of being "tossed" into a situation where I lose all control. I also don''t appreciate the expectation that I must always be the base for something greater. I am a leaf, not a foundation!', 'Patient was a NO_SHOW. Left a cryptic note: "Too much dressing today. Cannot risk being tossed." This confirms severe paranoia regarding his traditional role in a Caesar salad. The patient is suffering from "Tossing Trauma" and "Caesar-phobia." We need to work on the patient''s self-identity as an individual component rather than just a "vehicle" for dressing and croutons.', false, '2025-10-10 12:20:00', '2025-10-10 12:20:00'),
(36, '2025-10-11 10:30:00', 1800, 'SCHEDULED', 'Patty Pepper (Jalapeño)', 'patty@heat.com', '5550000036', 'I am afraid I am losing my heat. My capsaicin levels feel low. What if I am just a mild, insignificant pepper? My whole identity is based on my ability to inflict pain! If I lose my fire, I lose my purpose. I need a capsaicin boost! Also, I have a deep fear of being "stuffed" and "baked." It''s too vulnerable.', NULL, false, '2025-10-11 12:25:00', '2025-10-11 12:25:00'),
-- --- WEEK 3: Oct 13 - Oct 18 ---
(37, '2025-10-13 09:00:00', 1800, 'REQUESTED', 'Sammy Sweet Potato', 'sammy@tuber.com', '5550000032', 'This is a follow-up to my yam confusion. It''s getting worse. I went to a party and someone called me a "Jewel Yam." It sent me into a spiral! I have been stress-eating brown sugar. I think I need to explore my childhood, specifically the trauma of being harvested next to a field of true yams. I need cognitive restructuring!', NULL, false, '2025-10-11 12:30:00', '2025-10-11 12:30:00'),
(38, '2025-10-13 09:15:00', 2700, 'COMPLETED', 'Harriet Horseradish', 'harriet@root.com', '5550000038', 'I am volatile and intensely emotional, but I only let it out when I''m grated. I keep everything bottled up, but the moment I feel attacked, I explode into an abrasive, sinus-clearing fury. I need techniques to express my rage without needing physical destruction. I also feel my whiteness is "too bland" and needs color.', 'Patient is suffering from "Grating Rage Syndrome." She is calm but tense, noting that her true feelings are only released via enzymatic destruction. We discussed healthy boundaries and verbal expression. She needs to understand that not every minor inconvenience requires a full "nasal-clearing explosion." Recommended working with red beets to introduce color and emotional balance.', true, '2025-10-12 12:35:00', '2025-10-13 09:45:00'),
(39, '2025-10-13 14:00:00', 1800, 'SCHEDULED', 'Penelope Pea', 'penelope@pod.net', '5550000002', 'I''m back. My pod-mates won''t stop singing. They''ve formed an a cappella group, and I cannot escape the noise. It''s a constant, high-pitched humming about the "unity of the legume." I need noise-canceling technology or a transfer to a solo pod. I''m seriously contemplating rolling away again, potentially into traffic (the garden path).', NULL, false, '2025-10-12 12:40:00', '2025-10-12 12:40:00'),
(40, '2025-10-13 14:30:00', 1800, 'REQUESTED', 'Gary Ginger', 'gary@rhizome.org', '5550000040', 'I have a profound sense of "underground" guilt. I feel like I only surface when I''m needed to solve someone else''s digestive problem. I''m a remedy, not a personality. I want to be appreciated for my complex, zesty spirit, not just for my ability to cure nausea. I also have severe paranoia about being "candied."', NULL, false, '2025-10-13 12:45:00', '2025-10-13 12:45:00'),
(41, '2025-10-14 09:00:00', 1800, 'SCHEDULED', 'Bok Choy Bobby', 'bobby@asianleaf.net', '5550000041', 'I am vertically challenged. My leaves tower over my stems, and it makes me feel disproportionate. I''m a "two-part" vegetable, and I feel split between my "crunchy" identity and my "tender" identity. I am constantly worried about falling over and being stir-fried into oblivion. I need stability and validation for my stem structure.', NULL, false, '2025-10-13 12:50:00', '2025-10-13 12:50:00'),
(42, '2025-10-14 11:30:00', 1800, 'COMPLETED', 'Hazel Heart of Palm', 'hazel@palm.org', '5550000042', 'I am devastated by my origin story. I am the "heart" of the palm tree, which means for me to exist, the whole tree must be cut down! I am a symbol of tragedy and deforestation! I have immense survivor''s guilt. I taste delicious, but it''s the taste of sacrifice. I don''t know how to enjoy my tender, creamy life.', 'Patient is suffering from acute "Destructive Harvest Guilt." She believes her existence is inherently selfish and tragic. We discussed the circle of life in the garden, but she remains fixated on the "deforestation" required for her extraction. She needs intensive therapy to accept that she is the result of natural cycles, not a malicious entity. Patient is surprisingly high-fiber for a soft center.', true, '2025-10-14 12:55:00', '2025-10-14 12:55:00'),
(43, '2025-10-14 14:00:00', 1800, 'SCHEDULED', 'Gigi Grape Leaf', 'gigi@vine.com', '5550000043', 'I am defined by my filling. Everyone just wants to roll me up and stuff me with rice and meat! I am never the main character! I am just a wrapper, a container, a glorified culinary envelope. What if I want to be a salad? What if I want to just photosynthesize? I feel like I''m constantly being stretched and prepped for stuffing.', NULL, false, '2025-10-14 13:00:00', '2025-10-14 13:00:00'),
(44, '2025-10-14 14:15:00', 2700, 'REQUESTED', 'Fungi Freddy (Morel)', 'freddy@mycelium.com', '5550000044', 'I''m an elitist, and I need help. I look down on the common button mushrooms. I am expensive! I am rare! But I''m terrified I''m going to be confused for a deadly poisonous mushroom. The pressure of being the "exclusive" fungi is immense, and the thought of being misidentified and causing death is crushing my spirit.', NULL, false, '2025-10-14 13:05:00', '2025-10-14 13:05:00'),
(45, '2025-10-15 09:30:00', 1800, 'SCHEDULED', 'Red R. Ruby', 'ruby@redroot.org', '5550000045', 'I''m a red onion, and I''m the "fun" one, the "salad" onion. But I still make people cry! It''s a double-standard! I have to look pretty and taste zesty, but I still have the internal mechanism for tears. I also hate being pickled, it makes my beautiful color leach out into a sad pink brine. I feel like my existence is a performance.', NULL, false, '2025-10-15 13:10:00', '2025-10-15 13:10:00'),
(46, '2025-10-15 11:00:00', 1800, 'CANCELED', 'Ethel Eggplant', 'ethel@nightshade.com', '5550000026', 'I had to cancel! I got too close to a vat of olive oil and I nearly absorbed it all. My boundaries are non-existent! I''m too spongy to manage this stress. I need a flotation device or a temporary coating to prevent accidental, traumatic absorption. I''m also worried I''m starting to turn brown on the inside.', 'Patient CANCELED, citing an "oil spill near the office." Her "Porosity Panic" is clearly still in effect, and she is unable to maintain boundaries in high-oil environments. She is exhibiting signs of internal oxidation (browning). Recommended immediate rest in a dark, dry environment. Will send a follow-up packet on "Boundary Setting for Porous Produce."', true, '2025-10-15 13:15:00', '2025-10-15 13:15:00'),
(47, '2025-10-15 14:00:00', 1800, 'SCHEDULED', 'Peter Plantain', 'pete@starch.com', '5550000047', 'I am perpetually confused with a banana. People always grab me, expect me to be sweet, and then are bitterly disappointed when I''m starch. I''m meant for savory dishes! I''m a complex carbohydrate with texture! I am not a casual snack! The constant comparison is devaluing my identity, and I''m afraid of being fried incorrectly.', NULL, false, '2025-10-15 13:20:00', '2025-10-15 13:20:00'),
(48, '2025-10-16 09:00:00', 1800, 'REQUESTED', 'Gail Gherkin', 'gail@pickles.com', '5550000048', 'I am obsessed with my crunch. If I''m not crunchy, I''m nothing. I constantly test my structural integrity, but the stress is immense. I am afraid of going soft. I am a small cucumber, destined for greatness, but the thought of becoming a soggy, flabby pickle keeps me awake in brine-induced panic attacks.', NULL, false, '2025-10-16 13:25:00', '2025-10-16 13:25:00'),
(49, '2025-10-16 11:30:00', 1800, 'COMPLETED', 'Fungi Freddy (Morel)', 'freddy@mycelium.com', '5550000044', 'I need a second opinion. I was briefly placed next to a Chanterelle, and my anxiety flared up. Why aren''t I as orange? Why am I so pitted and conical? I feel like my appearance is becoming less "gourmet" and more "swamp monster." I also had a nightmare that I was sautéed with butter and wine, and it was *too* delicious, which invalidates my elitism.', 'Follow-up visit. The patient''s "Elitism" is clashing with his "Toxicity Paranoia." He is now comparing himself to other expensive fungi. The nightmare of being "too delicious" suggests his subconscious is challenging his need to remain aloof. We are working on accepting that value can exist without being rare or condescending. He is still obsessed with his conical shape.', true, '2025-10-16 13:30:00', '2025-10-16 12:05:00'),
(50, '2025-10-16 14:00:00', 1800, 'SCHEDULED', 'Squashy Sheldon', 'sheldon@gourd.org', '5550000050', 'I am afraid of my own shape. I am a crookneck squash, and my curve makes me feel like I am permanently leaning into bad life decisions. Why can''t I be straight, like a zucchini? The curve implies I am "irregular" and "imperfect." I spend my entire day trying to stand straight, and the tension in my vine is unbearable.', NULL, false, '2025-10-16 13:35:00', '2025-10-16 13:35:00'),
(51, '2025-10-17 09:30:00', 1800, 'SCHEDULED', 'Ingrid Iceberg', 'ingrid@crisp.net', '5550000051', 'I am suffering from immense self-doubt because I am 96% water and 0% nutrients. I feel utterly useless, yet I am inexplicably popular in fast-food settings. I am a shallow beauty! I want to be taken seriously, but I just keep thinking about how I will inevitably become a watery puddle on someone''s plate.', NULL, false, '2025-10-17 08:00:00', '2025-10-17 08:00:00'),
(52, '2025-10-17 11:30:00', 1800, 'REQUESTED', 'Paul Potato (Fingerling)', 'paul@finger.com', '5550000052', 'I am afraid of commitment. I am too small to be a Russet, and too big to be a baby potato. I am forever stuck in this "fingerling" stage, meaning I am frequently sliced lengthwise and pan-fried. I feel exposed and vulnerable. I need to figure out my place in the potato hierarchy before I become hash.', NULL, false, '2025-10-17 08:05:00', '2025-10-17 08:05:00'),
(53, '2025-10-17 14:00:00', 1800, 'COMPLETED', 'Ezekiel Endive', 'ezekiel@chicory.com', '5550000053', 'I am profoundly bitter. My bitterness is my defining trait, and it has alienated me from my peers. I believe I am bitter because the world has wronged me, but I also enjoy the sharp, aggressive edge it gives me. I need to know: can I be bitter *and* happy? I also fear being filled with goat cheese, which I find cloying.', 'Patient is experiencing "Chronic Chicory Cynicism" (CCC). His bitterness is a source of pride, yet it prevents deep connection. We discussed channeling his bitterness into a "constructive sharpness," rather than a "destructive cynicism." He has a severe phobia of creamy dips and cheeses. Advised him to seek out acidic dressings to complement his personality.', true, '2025-10-17 08:10:00', '2025-10-17 14:35:00'),
(54, '2025-10-18 09:00:00', 1800, 'SCHEDULED', 'Saffron Stem', 'saffron@spice.com', '5550000054', 'I am incredibly valuable and delicate, and the pressure is paralyzing. I am literally worth more than gold by weight! If I am handled incorrectly, I lose my flavor, my color, and my exorbitant market value. I fear being misused—thrown into a cheap rice dish where my complexity is lost. I need security detail!', NULL, false, '2025-10-18 08:15:00', '2025-10-18 08:15:00'),
(55, '2025-10-18 10:30:00', 1800, 'REQUESTED', 'Wally Watercress', 'wally@aquatic.net', '5550000055', 'I feel overwhelmed by my environment. I live in water! I am constantly soggy! It''s cold and wet all the time, and I''m perpetually worried about drowning. I also have a mild peppery taste, but I worry it''s not strong enough to be noticed. I''m just floating through life without a solid purpose or foundation.', NULL, false, '2025-10-18 08:20:00', '2025-10-18 08:20:00'),
-- --- WEEK 4: Oct 20 - Oct 25 ---
(56, '2025-10-20 09:30:00', 1800, 'CANCELED', 'Holly Hominy', 'holly@nixtamal.org', '5550000056', 'I don''t know who I am anymore. I was corn, then I was processed with lye (nixtamalization), and now I''m this bloated, chemically altered thing. I''ve lost my corn-identity! I''m a puffy imposter! I''m terrified of becoming a tortilla, which is just a flat version of my trauma. I feel like my past is constantly trying to flatten me.', 'Patient CANCELED. Sent a note saying she was "too puffed up with shame" to attend. She is suffering from severe "Nixtamalization Trauma" and an identity crisis stemming from chemical processing. She views her "puffy" appearance as a sign of irreversible damage. Her fear of becoming a tortilla is a fear of losing her 3D structure and individuality. Recommended self-soothing with warm air.', true, '2025-10-19 08:25:00', '2025-10-19 08:25:00'),
(57, '2025-10-20 10:00:00', 2700, 'SCHEDULED', 'Shelly Shell Bean', 'shelly@pole.net', '5550000057', 'I feel abandoned. I am always separated from my protective shell, my home. People just crack me open and discard my shell! It''s like my childhood is being ripped away over and over again. I want to feel secure outside of my pod. I have severe separation anxiety from my husk.', NULL, false, '2025-10-19 08:30:00', '2025-10-19 08:30:00'),
(58, '2025-10-20 14:00:00', 1800, 'COMPLETED', 'Phyllis Pickled Onion', 'phyllis@brine.com', '5550000058', 'I have an aggressive personality now. I used to be Olga Onion, but after the pickling, I am Phyllis! I''m vinegary, I''m pungent, and I don''t care who I offend. I believe my trauma gave me strength, but my friends say I''m just salty and acidic. I need to know: is this "new me" an improvement or a self-destructive defense mechanism?', 'Patient is a highly acidic personality with "Brine Identity Syndrome." She views her traumatic pickling as a "rebirth," but her increased aggression is alienating others. She claims the vinegar gives her "power." We discussed that while she is now "shelf-stable," she is also emotionally corrosive. Recommended a gradual reduction in her salt intake and exploring meditation to reduce acidity.', true, '2025-10-20 08:35:00', '2025-10-20 14:35:00'),
(59, '2025-10-21 09:00:00', 1800, 'SCHEDULED', 'Baron Borage', 'baron@flower.com', '5550000059', 'I am confusing. I am a beautiful blue flower, but I taste like cucumber! I don''t know where I belong! Am I an herb? Am I a garnish? Am I a tea? My identity is a blur, and it leads to massive anxiety. I worry people only use me for my aesthetics and don''t appreciate my complex, confusing flavor profile.', NULL, false, '2025-10-20 08:40:00', '2025-10-20 08:40:00'),
(60, '2025-10-21 10:30:00', 1800, 'REQUESTED', 'Quinn Quince', 'quinn@fruit.net', '5550000060', 'I am hard, fuzzy, and inedible when raw. I have to be boiled for hours, then sweetened to be palatable. I am high-maintenance and demanding, and I hate it! Why can''t I be an easy, ready-to-eat apple? I feel like I''m constantly forcing people to work for my affection, and my fuzzy coat is just a big defense mechanism.', NULL, false, '2025-10-20 08:45:00', '2025-10-20 08:45:00'),
(61, '2025-10-21 10:45:00', 2700, 'SCHEDULED', 'Patty Pepper (Jalapeño)', 'patty@heat.com', '5550000036', 'My Scoville levels are definitely dropping. I went to a party, and someone ate me *without* flinching. I felt completely emasculated! This is a crisis! I need a heat-boosting regimen, maybe a combination of intense sunlight and aggressive cross-breeding. I fear I will be downgraded to a bell pepper!', NULL, false, '2025-10-21 08:50:00', '2025-10-21 08:50:00'),
(62, '2025-10-21 14:00:00', 1800, 'COMPLETED', 'Peter Plantain', 'pete@starch.com', '5550000047', 'I''m having difficulty with my "starchiness." My family keeps trying to ripen me to make me sweet. They want me to be a banana! I have to constantly hide in the pantry to avoid being turned into a dessert. I need strategies to firmly assert my savory identity in the face of familial pressure.', 'Follow-up visit. Patient''s "Starch Stigma" is being exacerbated by family intervention. He feels his savory identity is under siege. We role-played assertive statements like, "I am a cooking banana, and I am meant for high heat, not morning cereal." Reinforced the difference between *Plantago* and *Musa* again. Recommended a temporary relocation to a deep fryer.', true, '2025-10-21 08:55:00', '2025-10-21 14:35:00'),
(63, '2025-10-22 09:30:00', 1800, 'REQUESTED', 'Rita Rutabaga', 'rita@brassica.org', '5550000063', 'I am perpetually confused for a swede, and I hate it! They''re the same thing! But that doesn''t help! I also hate my waxy, thick skin. It feels like a prison. I know I''m sweet on the inside, but nobody takes the time to peel and cook me. I''m too much effort, so I just sit here and wax my outer layer.', NULL, false, '2025-10-22 09:00:00', '2025-10-22 09:00:00'),
(64, '2025-10-22 10:00:00', 3600, 'SCHEDULED', 'Chandra Chard', 'chandra@swiss.com', '5550000064', 'I am confused by my name. I am **Swiss** Chard, but I am not from Switzerland! It''s a marketing lie that generates anxiety. Where are my roots? What am I standing for? Also, I have a brightly colored stem and a dull green leaf. I feel like my body is split into two conflicting personalities: one flashy, one muted.', NULL, false, '2025-10-22 09:05:00', '2025-10-22 09:05:00'),
(65, '2025-10-22 14:00:00', 1800, 'REQUESTED', 'Danny Dill', 'danny@herb.net', '5550000065', 'I feel weak. I''m just a flimsy, feathery herb. I look delicate, and I am delicate! I am constantly getting bruised and dried out. I want to be a strong, woody herb, like rosemary, with structural integrity. I''m tired of being associated only with pickles and salmon. My life is fleeting and fragile.', NULL, false, '2025-10-22 09:10:00', '2025-10-22 09:10:00'),
(66, '2025-10-22 14:15:00', 2700, 'COMPLETED', 'Cormac Celery Root', 'cormac@root.com', '5550000066', 'I am hideous. Look at me! I''m lumpy, covered in dirt, hairy, and just generally an unsightly mess. I have massive body image issues. I know I taste great, like a subtle celery, but nobody can get past my monstrous exterior. I wish I was smooth and elegant, like a parsnip. I feel like I need intense plastic surgery.', 'Patient is suffering from extreme "Root Vegetable Dysmorphia." He is obsessed with his lumpy, hairy, dirt-encrusted exterior. He views his rough appearance as a personal and moral failing, despite his excellent internal flavor profile. We discussed self-acceptance and the beauty of being "rustic." He needs to stop comparing himself to the smooth, pale root vegetables. Recommended embracing his natural texture.', true, '2025-10-22 09:15:00', '2025-10-22 14:45:00'),
(67, '2025-10-23 09:00:00', 1800, 'SCHEDULED', 'Timmy Taro', 'timmy@rhizome.com', '5550000067', 'I am afraid of my own sliminess. When I''m cut, I ooze this sticky, gooey substance, and I hate it! It makes me feel unclean and messy. I''m terrified of being mashed because I think I will just turn into a massive, sticky blob. I want to be dry and flaky, like a normal potato. I need to stop oozing!', NULL, false, '2025-10-23 09:20:00', '2025-10-23 09:20:00'),
(68, '2025-10-23 11:00:00', 1800, 'REQUESTED', 'Veronica Vicia Faba (Broad Bean)', 'vici@faba.com', '5550000068', 'I am stuck between a green identity and a white identity. When I''m young, I''m bright green and tender, but when I get old, I turn pale and require peeling. I hate the pressure of aging! I don''t want to lose my vibrancy and be forced to discard my outer skin. I want to stay eternally young and green!', NULL, false, '2025-10-23 09:25:00', '2025-10-23 09:25:00'),
(69, '2025-10-23 11:30:00', 1800, 'SCHEDULED', 'Alvin Allspice', 'alvin@spice.com', '5550000069', 'I am a one-man spice cabinet, and the responsibility is too much. I taste like cinnamon, cloves, and nutmeg all at once! This causes massive identity overload. I don''t know which flavor to lead with. I worry I''m just a "flavor mashup" without a singular identity. I need to simplify my flavor profile!', NULL, false, '2025-10-23 09:30:00', '2025-10-23 09:30:00'),
(70, '2025-10-23 15:00:00', 1800, 'REQUESTED', 'Ingrid Iceberg', 'ingrid@crisp.net', '5550000051', 'I am deeply distressed. I was used as the base for a greasy taco salad, and I started weeping! My water content couldn''t handle the heat or the oil, and I completely lost my crunch. I need an emergency session to re-establish my boundaries and structural integrity. I feel violated by the ground beef.', NULL, false, '2025-10-23 09:35:00', '2025-10-23 09:35:00'),
(71, '2025-10-24 09:30:00', 1800, 'SCHEDULED', 'Squashy Sheldon', 'sheldon@gourd.org', '5550000050', 'I’ve tried to straighten myself, but the curve is too ingrained. My chiropractor vine told me it’s anatomical. How can I accept this crookneck curvature? I also have a new fear: being turned into a clown face for a children''s play. My curve makes me look like I''m permanently smiling, and I''m not!', NULL, false, '2025-10-24 09:40:00', '2025-10-24 09:40:00'),
(72, '2025-10-24 10:00:00', 2700, 'REQUESTED', 'Gigi Grape Leaf', 'gigi@vine.com', '5550000043', 'I am desperate to be seen as more than a dolma wrap. I tried to stage a protest by tearing a hole in myself, but it just made me look like "damaged goods." I want to be a beautiful, unburdened leaf, but my destiny is servitude. I need a new destiny! I have a newfound phobia of the phrase "finger food."', NULL, false, '2025-10-24 09:45:00', '2025-10-24 09:45:00'),
(73, '2025-10-24 14:00:00', 1800, 'COMPLETED', 'Prudence Pimiento', 'prudence@capsicum.com', '5550000073', 'I am a shell of my former self. I am perpetually hollowed out, deveined, and stuffed into olives! I''ve lost all sense of self. I am defined by the pit I replace. I fear I am just a "vegetable prosthetic." I want to be a full, complete pepper, not a surgically altered, brine-soaked cavity filler.', 'Patient is suffering from "Vegetable Prosthetic Despair." She is deeply traumatized by the "hollowing out" process and the subsequent immersion in brine. She views her role in olives as a cruel joke. We discussed her importance as a flavor component, but she wants to be a whole entity. Recommended she find a support group for other "stuffed" or "hollowed" produce.', true, '2025-10-24 09:50:00', '2025-10-24 14:35:00'),
(74, '2025-10-24 14:15:00', 1800, 'SCHEDULED', 'Simon Scallion', 'simon@spring.com', '5550000074', 'I am experiencing profound ambiguity. I am not an onion, not a chive, not a leek. I am a *scallion*. I am forever stuck in this "green onion" purgatory. I am almost always sliced thinly, which is a constant reminder of my lack of bulk or depth. I need to find dignity in being a garnish!', NULL, false, '2025-10-24 09:55:00', '2025-10-24 09:55:00'),
(75, '2025-10-25 09:30:00', 1800, 'REQUESTED', 'Mister Mustard Green', 'mustard@leafy.com', '5550000075', 'I am furious. I am too spicy! When I''m cooked, I release a pungent, eye-watering odor that offends everyone. I need help controlling my internal volatile compounds. I want to be milder and more socially acceptable, like spinach. My life is a series of strong, angry flavors and pungent smells.', NULL, false, '2025-10-25 10:00:00', '2025-10-25 10:00:00'),
(76, '2025-10-25 10:45:00', 1800, 'CANCELED', 'Cornelius ''Corny'' Corn', 'c.c@husk.org', '5550000008', 'I was too distressed by the GMO documentary to leave the crib. My existential modification dread has peaked, and I cannot face the public until I have definitive proof that I am not a genetically engineered super-maize destined for a popcorn singularity. The shame is immense, and the husk is too tight for travel.', 'Patient CANCELED the appointment with no prior notice. He is still highly paranoid about his genetic origins and potential modification. The corn kernel security blanket seems insufficient. Clinician fears the patient is spiraling into a deep "agri-science" induced neurosis. Must attempt contact again, perhaps offering non-GMO, organic therapy options.', true, '2025-10-25 10:05:00', '2025-10-25 10:05:00'),
-- --- WEEK 5: Oct 27 - Nov 1 ---
(77, '2025-10-27 09:00:00', 1800, 'NO_SHOW', 'Felix Fiddlehead', 'felix@fern.com', '5550000077', 'I was stressed about my brief season of popularity, and the pressure to be exotic and highly sought-after in that short window was too much. I failed to uncurl from my fetal shape, which I view as a complete psychological collapse. I could not face the clinician while still physically resembling a tightly wound coil of self-doubt and pre-spring anxiety.', 'Patient NO_SHOW. I suspect his "Transient Popularity Anxiety" caused a physical paralysis, preventing him from uncoiling and leaving the forest floor. The patient views his coiled shape as a sign of being emotionally stunted. Sent a gentle reminder that he is valuable, even if his season is brief, and suggested a focus on vertical growth next time.', false, '2025-10-26 10:10:00', '2025-10-26 10:10:00'),
(78, '2025-10-27 11:30:00', 1800, 'RESCHEDULED', 'Rita Radicchio', 'rita@chicory.com', '5550000078', 'I am visually stunning, but my bitterness is an internal battle. I need more time to manage the profound internal cynicism that defines me, as I fear I will offend the clinician with my sharp, aggressive nature. I need to be less beautiful and less bitter before I can have a productive session.', 'Patient RESCHEDULED to a later date, citing a need to "temper her internal acidity." She is struggling with her "Aesthetic Deception Guilt." We need to work on embracing her bitterness as "depth" rather than a flaw. Recommended a session of light roasting and a drizzle of honey before the next appointment to manage volatility.', false, '2025-10-26 10:15:00', '2025-10-26 10:15:00'),
(79, '2025-10-27 14:00:00', 1800, 'CANCELED', 'Sammy Seaweed (Nori)', 'sammy@ocean.net', '5550000079', 'I am flat, dry, and always being rolled up around something else. I had an accident—I briefly touched a damp cloth and my structural integrity was compromised. I am now a soggy, amorphous mess. I cannot be transported in this state, as I fear complete dissolution. The slightest moisture is my mortal enemy.', 'Patient CANCELED due to a transportation accident involving environmental moisture. His "Aquatic Identity Misclassification" is secondary to his "Moisture Phobia." His refusal to be soggy is absolute, despite his marine origin. Recommended immediate heat lamp exposure and a protective seal for future visits. The session was literally too wet to happen.', true, '2025-10-27 10:20:00', '2025-10-27 10:20:00'),
(80, '2025-10-28 09:30:00', 1800, 'NO_SHOW', 'Arturo Arugula', 'arturo@spicy.com', '5550000080', 'I am high-strung and easily agitated. I was worried about "bolting" during the 30-minute commute, so I decided to stay home and focus on shallow, controlled growth. The risk of becoming too bitter and large to enter the office was too great, and I couldn''t risk the structural integrity of my spicy leaves.', 'Patient NO_SHOW. I believe his "Size-Related Flavor Anxiety" prevented him from leaving the garden. He is obsessed with maintaining a small, palatable size and views growth as a betrayal of his flavor profile. Sent a note stating that bitterness is a natural phase of life, not a moral failing. Must address his "bolting" fears in the next session.', false, '2025-10-28 10:25:00', '2025-10-28 10:25:00'),
(81, '2025-10-28 11:00:00', 1800, 'RESCHEDULED', 'Mister Millet', 'mister@grain.com', '5550000081', 'I need to postpone my visit. I just saw Quinoa on the cover of a major food magazine, and my "Pseudocereal Obscurity Syndrome" flared up severely. I need time to emotionally process the inequality of the grain hierarchy before I can focus on my own well-being. My depression regarding being relegated to "birdseed" is too acute today.', 'Patient RESCHEDULED citing a competitive trauma response triggered by a high-profile competitor. His envy of Quinoa is a major impediment to his therapy. We discussed focusing on his own unique strengths, but he is fixated on achieving celebrity status. Must prepare for a deep dive into the marketing failures of pseudocereals next time.', false, '2025-10-28 10:30:00', '2025-10-28 10:30:00'),
(82, '2025-10-28 14:00:00', 1800, 'CANCELED', 'Giselle Green Pea', 'giselle@pod.net', '5550000082', 'I was accidentally subjected to a blast chiller! My body is frozen solid, and I cannot be moved. I am experiencing the very "Preservation Phobia" I came here to discuss. This is a traumatic event! I fear I will remain in this unnatural, preserved state forever, my "fresh identity" lost to the freezer burn of time.', 'Patient CANCELED following an acute traumatic incident (accidental freezing). This confirms her deep-seated fear of preservation. Her "fresh identity" is temporarily suspended. Recommended slow thawing and gentle reintroduction to the real world. This is a profound case of fear manifesting into reality, requiring specialized post-thaw counseling.', true, '2025-10-28 10:35:00', '2025-10-28 10:35:00'),
(83, '2025-10-29 09:00:00', 1800, 'NO_SHOW', 'Yvonne Yucca Root', 'yvonne@starch.org', '5550000083', 'I became too hard to transport safely. I tried to be peeled and sliced for travel, but the effort required was too immense, and I stalled the entire transport system. I decided it was safer for everyone if I just stayed home and remained in my rough, protective, inedible state.', 'Patient NO_SHOW. Her "High-Effort Existentialism" has materialized as a physical barrier to treatment. She needs extensive processing to be safely handled. Sent a reminder that her intrinsic value is not tied to the amount of labor she requires. Must schedule a longer appointment next time, perhaps requiring industrial-grade peeling equipment.', false, '2025-10-29 10:40:00', '2025-10-29 10:40:00'),
(84, '2025-10-29 11:30:00', 1800, 'RESCHEDULED', 'Reggie Rhubarb', 'reggie@stalk.com', '5550000084', 'I need to push this appointment back to January. December is the height of the holiday baking season, and my "Pie Destiny Avoidance" is too strong right now. I cannot mentally cope with the thought of being boiled down and sugared into a dessert. I need to assert my savory identity in a less stressful month.', 'Patient RESCHEDULED to a post-holiday date to avoid triggering his "Pie Destiny Anxiety." He is deeply resistant to his traditional culinary fate. We are working on viewing his stalk form as a symbol of savory resilience. Recommended avoiding eye contact with any pastry chefs or sugar bowls until the New Year.', false, '2025-10-29 10:45:00', '2025-10-29 10:45:00'),
(85, '2025-10-29 14:00:00', 1800, 'CANCELED', 'Fanny Fava Bean', 'fanny@faba.com', '5550000085', 'I saw a bottle of Chianti on the waiting room table during a scouting trip, and I panicked! The association with Hannibal Lecter and cannibalism is too strong! My "Culinary Pop Culture Trauma" has reasserted itself, and I cannot attend. I fear I will be paired with an intellectual predator.', 'Patient CANCELED at the last minute. The mere sight of an associated prop (Chianti) triggered her "Fava Bean Sinister Stigmatization." She believes she is a cursed ingredient. Clinician must ensure the waiting room is free of all references to psychological thrillers and Italian red wine before the next session.', true, '2025-10-29 10:50:00', '2025-10-29 10:50:00'),
(86, '2025-10-30 09:30:00', 1800, 'NO_SHOW', 'Gideon Grain (Quinoa)', 'gideon@trendy.net', '5550000086', 'I am currently too important to attend therapy. I am being flown first-class to a major food conference as a "complete protein" keynote speaker. My schedule cannot accommodate an appointment with mere vegetable clinicians. My fame is currently at its zenith, and I refuse to interrupt the glory for introspection.', 'Patient NO_SHOW. Reason given was extreme arrogance and an over-inflated sense of self-importance due to his "Celebrity Pseudocereal" status. His lack of humility is now affecting his adherence to his own schedule. Must address this severe case of narcissism when he finally descends from his high horse.', false, '2025-10-30 10:55:00', '2025-10-30 10:55:00'),
(87, '2025-10-30 11:00:00', 1800, 'RESCHEDULED', 'Herman Herb (Basil)', 'herman@pesto.com', '5550000087', 'I need to postpone. The temperature is rising outside, and my "Oxidation Anxiety" is peaking. I fear I will turn black and lose all value before I reach the office. I must wait for a cooler, safer day, or else my session will devolve into a discussion about my premature moral decay.', 'Patient RESCHEDULED due to high environmental heat, triggering his fear of "browning" and "moral decay." He is highly sensitive to his freshness. We must schedule his appointments for early morning or late evening when oxidation risk is lowest. Sent self-care tips focusing on anti-oxidant rich pairings like lemon juice.', false, '2025-10-30 11:00:00', '2025-10-30 11:00:00'),
(88, '2025-10-30 14:00:00', 1800, 'CANCELED', 'Olive Oil Olive', 'olive@olea.com', '5550000088', 'I am suffering from a profound crisis. I was in transit, but my container developed a micro-fissure, and I began to slowly leak out. I cannot continue my journey while I am literally losing my fluid identity. I must return to storage and mourn the loss of my precious, cold-pressed essence.', 'Patient CANCELED. The "Liquefaction Trauma" has been physically realized by a container breach, causing the patient to lose volume and form. The loss of essence is a devastating blow to her already fragile, fluid identity. Recommended immediate resealing and emotional stabilization before attempting travel again.', true, '2025-10-30 11:05:00', '2025-10-30 11:05:00'),
(89, '2025-10-31 09:00:00', 1800, 'NO_SHOW', 'Mandy Manioc', 'mandy@cassava.com', '5550000089', 'I was too afraid to leave my safe preparation area. I feared that if I was improperly jostled or bumped, I might release residual toxins and harm the other waiting patients. My burden of toxicity is too immense to risk the trip. I need a solo, sealed session when the facility is empty.', 'Patient NO_SHOW. Her "Toxicity Guilt" is preventing her from engaging with the outside world. She views herself as a potential biological hazard. We must find a way to convince her that her *prepared* state is safe, otherwise, she will remain isolated. A sterile, sealed environment for the next session is advisable.', false, '2025-10-31 11:10:00', '2025-10-31 11:10:00'),
(90, '2025-10-31 11:30:00', 1800, 'RESCHEDULED', 'Pippa Purslane', 'pippa@succulent.net', '5550000090', 'I need to postpone immediately! The Head Gardener is doing his rounds, and I was nearly mistaken for a common weed and ripped out of the ground! My "Weed Shame" and fear of the trowel are at an all-time high. I need to hide until the danger passes and the gardener is occupied elsewhere.', 'Patient RESCHEDULED due to a genuine threat of uprooting by the Head Gardener. Her "Weed Shaming" is justified by the current external threat. Recommended she find a safe, inconspicuous place to wait until the next session. This case requires addressing both internal shame and external discrimination.', false, '2025-10-31 11:15:00', '2025-10-31 11:15:00'),
(91, '2025-10-31 14:00:00', 1800, 'CANCELED', 'Salty Sam (Caper)', 'salty@brine.com', '5550000091', 'I was rinsed! A careless intern thought I was too salty and put me under the tap! I am watered down, stripped of my briny character, and now I feel utterly meaningless. I am no longer a caper, I am a bland, flavorless bud. I cannot attend therapy while suffering from this profound identity loss.', 'Patient CANCELED due to traumatic rinsing. His "Punctuation Syndrome" is now compounded by a "Brine Identity Loss." He is a shadow of his former, salty self. Recommended immediate re-brining therapy to restore his core character and dignity. The intern has been advised that capers should never be rinsed.', true, '2025-10-31 11:20:00', '2025-10-31 11:20:00'),
(92, '2025-11-01 09:30:00', 1800, 'NO_SHOW', 'Tofu Tina', 'tina@soy.net', '5550000092', 'I was pressed into a new, extremely dense block this morning. I am now too heavy and rigid to move, and my texture is all wrong. I feel like my essence has been violently extracted. I cannot come to the office until I have re-established my structural integrity and mourned the loss of my initial fluffiness.', 'Patient NO_SHOW. She was subject to excessive pressing, leaving her too dense and structurally rigid to mobilize. Her "Imposter Protein Syndrome" is intensified by the feeling that her form is constantly being manipulated. Must schedule the next appointment when she is in a softer, more manageable state.', false, '2025-11-01 11:25:00', '2025-11-01 11:25:00'),
(93, '2025-11-01 11:00:00', 1800, 'RESCHEDULED', 'Shelly Shell Bean', 'shelly@pole.net', '5550000057', 'I had a breakthrough, but the emotional cost was immense. My "Refried Repetition Anxiety" is still too active. I need a week to process the concept of existing without being mashed. I fear that if I come in now, I will be psychologically vulnerable to the next phase of consumption. I need to stay whole for a bit longer.', 'Patient RESCHEDULED to give herself time to process the emotional breakthrough and manage her lingering "Refried Repetition Anxiety." She is making progress on accepting her "whole bean" identity but requires continued support to overcome her fear of mashing. Advised her to avoid all culinary processes involving high pressure.', false, '2025-11-01 11:30:00', '2025-11-01 11:30:00'),
(94, '2025-11-03 09:30:00', 1800, 'CANCELED', 'Celine Collard Green', 'celine@southern.com', '5550000094', 'I am still too tough! I started boiling myself at 5 AM, and I am still resisting softening. I cannot attend therapy until I am sufficiently yielded to the forces of heat and water. My fibrous resistance is a chronic scheduling issue. I will not come until I can present a non-chewy version of myself.', 'Patient CANCELED. Her "Chronic Fibrous Resistance" is a literal barrier to her attendance. She refuses to seek help until she has met an impossible standard of tenderness. We must address the pride she takes in her toughness versus the practical scheduling difficulties it creates. Referred to an industrial pressure cooker specialist for faster softening.', true, '2025-11-02 11:35:00', '2025-11-02 11:35:00'),
-- --- WEEK 6: Nov 3 - Nov 8 ---
(95, '2025-11-03 11:00:00', 1800, 'NO_SHOW', 'Arturo Arugula', 'arturo@spicy.com', '5550000080', 'I have fully bolted. I am now a towering seed stalk! I couldn''t fit through the door of the office! My existence as a consumer-grade leaf is over, and I am now dedicated to seed production. I am too big and too bitter for the waiting room. My failure is magnificent, and I refuse to be cut down.', 'Patient NO_SHOW. He has transitioned into his reproductive phase, making him physically incompatible with the office space. His "Bolting Catastrophe" is now complete, and he views his bitterness as wisdom. Must schedule a large outdoor session or communicate via long-distance drone camera for the next check-in.', false, '2025-11-02 11:40:00', '2025-11-02 11:40:00'),
(96, '2025-11-03 14:00:00', 1800, 'RESCHEDULED', 'Mister Mustard Green', 'mustard@leafy.com', '5550000075', 'I need more time to develop my layers! My "Layer Envy" (Artichoke-envy) is too strong, and I cannot face the public until I have figured out a way to physically fold myself into a more complex, protected head. I need time for intensive internal restructuring!', 'Patient RESCHEDULED. He is obsessed with achieving the physical complexity of an artichoke to manage his volatile emotional state. He refuses to attend until he has developed sufficient physical boundaries. Recommended a referral to a top vegetable origami specialist, as structural change is biologically impossible.', false, '2025-11-03 11:45:00', '2025-11-03 11:45:00'),
(97, '2025-11-04 09:00:00', 1800, 'CANCELED', 'Bertram Bamboo Shoot', 'bertram@shoot.com', '5550000097', 'I grew too tall! Since booking, I have grown over three feet and burst through the roof of my container! I cannot be safely transported or contained. My "Rapid Growth Anxiety" has become a literal, architectural problem. I will have to cancel until I can control my vertical trajectory.', 'Patient CANCELED due to uncontrollable rapid growth, resulting in structural failure of his container. His "Woodiness Phobia" is still active, but his immediate problem is being too tall for society. Recommended seeking counseling from a very large tree or skyscraper to manage his immense scale.', true, '2025-11-03 11:50:00', '2025-11-03 11:50:00'),
(98, '2025-11-04 11:30:00', 1800, 'NO_SHOW', 'Opal Okra', 'opal@goo.org', '5550000098', 'I am too slimy to touch the door handle! My mucilage levels are spiking, and I cannot risk leaving a trail of textural failure through the office. I am trapped by my own internal structure. I will have to remain here until my "Mucilage Shame" subsides or someone invents anti-goo technology.', 'Patient NO_SHOW. Her "Mucilage Shame" has escalated into physical paralysis. She fears contact due to her texture. Sent instructions for dry-roasting self-therapy at home, as this cooking method reduces sliminess and may give her the courage to attend a future session.', false, '2025-11-04 11:55:00', '2025-11-04 11:55:00'),
(99, '2025-11-04 14:00:00', 1800, 'RESCHEDULED', 'Wanda Wasabi', 'wanda@spice.org', '5550000099', 'I need to postpone the session. I just found another counterfeit paste being sold as me! I must dedicate all my resources to proving my authenticity and suing the fake horseradish industry. I cannot focus on my own emotional needs while my core identity is being actively stolen.', 'Patient RESCHEDULED due to an escalating legal battle against "Identity Theft" by the horseradish industry. Her paranoia is valid, but the focus on external validation is hindering therapy. Advised her to focus on *her* unique zing, regardless of market competition. Needs to bring forensic evidence to the next session.', false, '2025-11-04 12:00:00', '2025-11-04 12:00:00'),
(100, '2025-11-05 09:30:00', 1800, 'CANCELED', 'The entire Vegetable Kingdom', 'kingdom@earth.org', '5550000100', 'We have reached a collective agreement that the consumption of our brethren by sentient beings is too high a psychological burden to bear. The weight of being delicious and existentially complex has caused mass emotional retreat. We demand a collective moment of silence, not a therapy session, until our fate is clarified.', 'Group session CANCELED. The collective burnout and existential dread of the Vegetable Kingdom has reached critical mass, leading to a system-wide emotional shutdown. The representatives refused to leave their assigned patches. Recommended a temporary moratorium on harvesting activities to stabilize the mental health of the plant population.', true, '2025-11-04 12:05:00', '2025-11-04 12:05:00'),
(101, '2025-11-05 11:00:00', 1800, 'SCHEDULED', 'Bessie Basil', 'bessie@pesto.net', '5550000101', 'I am suffering from intense body image issues because my leaves keep curling inward. I try to be flat and uniform, but I just end up looking crumpled, which I fear reduces my value for pesto blending. I also hate the smell of pine nuts—it triggers my childhood trauma.', NULL, false, '2025-11-05 12:10:00', '2025-11-05 12:10:00'),
(102, '2025-11-05 14:00:00', 1800, 'REQUESTED', 'Rocky Romaine', 'rocky@cos.net', '5550000102', 'I am worried about my density. I am too crunchy! People expect soft, limp lettuce, and I keep over-performing. I need to learn to relax my cellular structure to avoid being perceived as aggressive or overly robust. I also have deep-seated trust issues with dressings that are too thin.', NULL, false, '2025-11-05 12:15:00', '2025-11-05 12:15:00'),
(103, '2025-11-06 09:00:00', 1800, 'COMPLETED', 'Sunny Scallopini', 'sunny@gourd.org', '5550000103', 'I have a profound guilt complex about being harvested too early. I feel like I robbed the world of my full potential as a gigantic, hard gourd. Instead, I am small, tender, and quickly consumed. I want to age gracefully, not be a fleeting summer squash memory. I need to embrace delayed gratification.', 'Patient suffers from "Premature Harvest Trauma." He views his tenderness as a lack of maturity. We explored the possibility of his life being valuable even if brief. He displayed profound bitterness toward his own seeds, which he feels contain his "stolen potential." Suggested he avoid comparing himself to the late-harvest winter squashes.', true, '2025-11-05 12:20:00', '2025-11-06 09:35:00'),
(104, '2025-11-06 11:30:00', 3600, 'SCHEDULED', 'Olive Oil Olive', 'olive@olea.com', '5550000088', 'I am returning after my cancellation. I have managed to reseal my container, but I am now struggling with my "fluid identity." I am oil, but I still believe I am a fruit. The separation from my solid state is a constant source of grief and viscosity issues. I want to return to a solid state.', NULL, false, '2025-11-06 12:25:00', '2025-11-06 12:25:00'),
(105, '2025-11-06 14:00:00', 1800, 'REQUESTED', 'Mandy Manioc', 'mandy@cassava.com', '5550000089', 'I am back to discuss my "Toxicity Guilt." I feel immense pressure knowing that improper preparation could harm my consumer. I want to be able to trust my own system, but the knowledge that I contain latent poison is psychologically crippling. I need a certification of safety.', NULL, false, '2025-11-06 12:30:00', '2025-11-06 12:30:00'),
(106, '2025-11-07 09:00:00', 1800, 'NO_SHOW', 'Wally Watercress', 'wally@aquatic.net', '5550000055', 'I feel overwhelmed by my environment. I am constantly soggy, and I was unable to detach from the riverbank today. My lack of solid roots led to a profound inability to travel. I fear I will forever be tethered to my aquatic existence, unable to function in a terrestrial setting.', 'Patient NO_SHOW. Cited "failure to detach from the riverbank." His "Aquatic Existential Dread" has led to physical rootedness. Recommended a team of professional aquatic movers for the next session. This patient requires anchoring therapy to establish a sense of terrestrial belonging.', false, '2025-11-07 12:35:00', '2025-11-07 12:35:00'),
(107, '2025-11-07 10:30:00', 1800, 'SCHEDULED', 'Paul Potato (Fingerling)', 'paul@finger.com', '5550000052', 'I am worried about my size. I am too small to be respected but too big to be cute. The middle-ground of "fingerling" is an identity purgatory. I need to accept my destiny is not to be a massive, fluffy Russet but a dense, thin-skinned utility potato. I also fear being mistaken for a sweet potato.', NULL, false, '2025-11-07 12:40:00', '2025-11-07 12:40:00'),
(108, '2025-11-07 10:45:00', 3600, 'COMPLETED', 'Holly Hominy', 'holly@nixtamal.org', '5550000056', 'I am returning after my cancellation. I''m still battling my "Nixtamalization Trauma" and my identity as a bloated, processed corn. I need reassurance that I am not an imposter and that my puffy state is merely a necessary evolution, not a betrayal of my original corn-kernel self.', 'Patient returned, showing visible signs of shame and puffiness. We reinforced that nixtamalization is a cultural and chemical enrichment, not a degradation. Her fear of becoming a tortilla (being flattened) is subsiding but remains a central neurosis. Recommended a mild alkaline bath for emotional maintenance.', true, '2025-11-07 12:45:00', '2025-11-07 11:45:00'),
(109, '2025-11-08 09:00:00', 1800, 'REQUESTED', 'Rocky Romaine', 'rocky@cos.net', '5550000102', 'I had a panic attack when I saw a bowl of croutons. They look like the bones of my ancestors! I fear all dry, crispy things. This "crunchiness" phobia is preventing me from entering most salad bars. I need techniques to distinguish friendly crunch from predatory crunch.', NULL, false, '2025-11-08 12:50:00', '2025-11-08 12:50:00'),
(110, '2025-11-08 10:30:00', 1800, 'SCHEDULED', 'Sunny Scallopini', 'sunny@gourd.org', '5550000103', 'I am struggling with my name. "Scallopini" sounds frivolous and shallow. I want a name that reflects my heritage, like "Squash-of-Serious-Intent." The lightness of my identity is deeply upsetting. I fear I will only ever be used as a cute, decorative side dish.', NULL, false, '2025-11-08 12:55:00', '2025-11-08 12:55:00'),
-- --- WEEK 7: Nov 10 - Nov 15 ---
(111, '2025-11-10 09:30:00', 1800, 'REQUESTED', 'Prudence Pimiento', 'prudence@capsicum.com', '5550000073', 'I need a follow-up for my "Vegetable Prosthetic Despair." I was briefly removed from an olive and placed on a charcuterie board, where I felt immense exposure. I realized I crave the darkness and briny protection of the olive cavity. I need to accept my destiny as a pit replacement.', NULL, false, '2025-11-09 13:00:00', '2025-11-09 13:00:00'),
(112, '2025-11-10 09:45:00', 3600, 'COMPLETED', 'Bessie Basil', 'bessie@pesto.net', '5550000101', 'My leaves have begun to wilt slightly, and I''ve spiraled into a panic about my freshness. This wilting feels like a sign of internal failure and impending blend-ification. I need immediate rehydration and professional assurance that I am still worthy of being used whole, not just chopped up.', 'Patient presented with mild wilting, triggering an acute panic attack. We performed immediate misting therapy and practiced "Freshness Affirmations." Her fear of the blender is still high. We are working on accepting that wilting is a temporary state, not a permanent moral decay. Advised her to avoid direct sunlight for a few days.', true, '2025-11-09 13:05:00', '2025-11-10 10:45:00'),
(113, '2025-11-10 14:00:00', 1800, 'SCHEDULED', 'Shelly Shell Bean', 'shelly@pole.net', '5550000057', 'I am back to discuss my "whole bean" identity. I was successfully shelled, but now I fear I am too small to be noticed. I am not a big Lima bean! I am a delicate shell bean, and I fear being overlooked in the great legume mix. I need to assert my small-but-mighty presence.', NULL, false, '2025-11-10 13:10:00', '2025-11-10 13:10:00'),
(114, '2025-11-10 14:15:00', 1800, 'REQUESTED', 'Saffron Stem', 'saffron@spice.com', '5550000054', 'I need a security assessment. I feel my environment is compromising my immense value. I was left near some cheap turmeric, and I fear my golden essence was spiritually tainted. I require a sealed, climate-controlled vault for my therapy sessions. My "Luxury Commodity Anxiety" is through the roof.', NULL, false, '2025-11-10 13:15:00', '2025-11-10 13:15:00'),
(115, '2025-11-11 09:00:00', 1800, 'COMPLETED', 'Opal Okra', 'opal@goo.org', '5550000098', 'I am back after my NO_SHOW. I managed to dry-roast myself a bit, reducing the mucilage, but now I feel too rigid! I am struggling to find the middle ground between slimy despair and desiccated hardness. I want to be *slightly* moist, but not offensively gooey. This textural balance is crippling.', 'Patient achieved enough dryness to attend the session. She is now experiencing "Textural Balance Dysphoria." We discussed the Okra dilemma: achieving "non-slimy" often means "too dry." Suggested pan-frying therapy for controlled viscosity. Must continue working on accepting the intrinsic nature of the mucilage.', true, '2025-11-11 13:20:00', '2025-11-11 09:35:00'),
(116, '2025-11-11 11:30:00', 1800, 'SCHEDULED', 'Wanda Wasabi', 'wanda@spice.org', '5550000099', 'I need to discuss my legal defense against the horseradish cartel. My "Identity Theft Paranoia" has led me to hire a forensic mycologist to prove my unique DNA. I am burning through my reserves, and the stress is dulling my pungency. I must find a way to maintain my zing while fighting for my legal rights.', NULL, false, '2025-11-11 13:25:00', '2025-11-11 13:25:00'),
(117, '2025-11-11 14:00:00', 1800, 'REQUESTED', 'Felix Fiddlehead', 'felix@fern.com', '5550000077', 'I am back to discuss my "Transient Popularity Anxiety." The spring rush is far away, and I am already feeling the seasonal obscurity. I fear I will be forgotten until the snow melts. I need strategies to maintain relevance and visibility during the long winter months.', NULL, false, '2025-11-11 13:30:00', '2025-11-11 13:30:00'),
(118, '2025-11-12 09:00:00', 1800, 'SCHEDULED', 'Celine Collard Green', 'celine@southern.com', '5550000094', 'I am back after my cancellation. My "Chronic Fibrous Resistance" is still strong. I refuse to be easily softened. I want to be resilient and tender, but not a mush. I need a middle path between tough integrity and palatable softness. My history requires I remain unyielding.', NULL, false, '2025-11-12 13:35:00', '2025-11-12 13:35:00'),
(119, '2025-11-12 11:00:00', 3600, 'COMPLETED', 'Mister Mustard Green', 'mustard@leafy.com', '5550000075', 'I have made peace with my "Aggressive Volatility Syndrome." I will no longer suppress my pungent odor, but I now have "Layer Envy" (Artichoke-envy). I need to figure out how to fold my flat leaves into a protective, multi-layered head to appear more complex.', 'Patient has accepted his volatility but developed a new "Layer Envy." His desire for physical complexity is a defense mechanism against being a "simple leaf." We discussed his genetic limitations (he cannot form a head). Recommended he use other leaves to wrap himself temporarily for self-soothing.', true, '2025-11-12 13:40:00', '2025-11-12 12:00:00'),
(120, '2025-11-12 14:00:00', 1800, 'REQUESTED', 'Pippa Purslane', 'pippa@succulent.net', '5550000090', 'I need a follow-up after my rescheduled appointment. I am still struggling with "Weed Shame." I am delicious, but I can''t shake the feeling that I am an unwanted, low-status interloper. I need to accept that abundance and ubiquity are not flaws.', NULL, false, '2025-11-12 13:45:00', '2025-11-12 13:45:00'),
(121, '2025-11-13 09:30:00', 1800, 'SCHEDULED', 'Tofu Tina', 'tina@soy.net', '5550000092', 'I am back to discuss my "Imposter Protein Syndrome." I fear I am not a real food but a culinary concept. My lack of inherent flavor is a massive source of insecurity. I need help finding my *true* flavor, not just the one I absorb from surrounding ingredients.', NULL, false, '2025-11-13 13:50:00', '2025-11-13 13:50:00'),
(122, '2025-11-13 10:00:00', 2700, 'REQUESTED', 'Bertram Bamboo Shoot', 'bertram@shoot.com', '5550000097', 'I am struggling with my "Woodiness Phobia." I know that if I don''t slow my growth, I will become tough and inedible. My fate is to become mere furniture, not food! I need a medical intervention to stunt my vertical growth immediately.', NULL, false, '2025-11-13 13:55:00', '2025-11-13 13:55:00'),
(123, '2025-11-13 14:00:00', 1800, 'COMPLETED', 'Yvonne Yucca Root', 'yvonne@starch.org', '5550000083', 'I managed to get processed safely! But now I have "Frying Anxiety." I am worried that my high starch content will cause me to explode violently in the oil. I want to be crispy and safe, not shrapnel. I need assurance that I am ready for high-temperature immersion.', 'Patient presented post-preparation. She is now suffering from thermal processing phobia. We discussed the physics of safe frying (temperature control) to alleviate her fear of becoming shrapnel. Recommended starting with a low-heat, shallow fry for self-confidence.', true, '2025-11-13 14:00:00', '2025-11-13 14:35:00'),
(124, '2025-11-14 09:00:00', 1800, 'SCHEDULED', 'Sammy Seaweed (Nori)', 'sammy@ocean.net', '5550000079', 'I am back after my cancellation. I have a professional-grade, sealed container now. I need to discuss my "Aquatic Identity Misclassification." I am tired of being called a vegetable when I am algae! My entire life is a lie perpetuated by sushi chefs!', NULL, false, '2025-11-14 14:05:00', '2025-11-14 14:05:00'),
(125, '2025-11-14 10:30:00', 1800, 'REQUESTED', 'Gideon Grain (Quinoa)', 'gideon@trendy.net', '5550000086', 'I am back, reluctantly. I am suffering from "Post-Fame Depression." The media attention is fading, and I fear being forgotten like poor Mister Millet. My "complete protein" status feels threatened. I need a new, viral marketing strategy to maintain my celebrity status and nutritional dominance.', NULL, false, '2025-11-14 14:10:00', '2025-11-14 14:10:00'),
(126, '2025-11-14 14:00:00', 3600, 'SCHEDULED', 'Fanny Fava Bean', 'fanny@faba.com', '5550000085', 'I have secured a session without the risk of Chianti! Now I must address my "Sinister Stigmatization." I want the world to see me as a hearty legume, not a footnote in a cannibal''s memoir. I need a personality makeover that says "wholesome" and not "intellectual murder."', NULL, false, '2025-11-14 14:15:00', '2025-11-14 14:15:00'),
(127, '2025-11-15 09:30:00', 1800, 'COMPLETED', 'Herman Herb (Basil)', 'herman@pesto.com', '5550000087', 'I finally scheduled on a cool day! My "Oxidation Anxiety" is manageable. I need to discuss my inability to trust water. I feel like water is trying to trick me into turning black. I only trust oil now, but oil is too calorie-dense. I need a neutral hydration strategy.', 'Patient successfully attended on a cool, overcast day. He has transferred his anxiety from air to water, fearing hydration will trigger oxidation. We discussed using a light, acidic spritz (lemon) as a compromise. His reliance on oil for security is noted but discouraged due to caloric implications.', true, '2025-11-15 14:20:00', '2025-11-15 10:05:00'),
(128, '2025-11-15 11:00:00', 1800, 'SCHEDULED', 'Opal Okra', 'opal@goo.org', '5550000098', 'I am back to discuss my "slimy" issues again. I am terrified of high-moisture cooking. The thought of being in gumbo or boiled fills me with textural shame. I need reassurance that frying is a safe, anti-slime method of consumption.', NULL, false, '2025-11-15 14:25:00', '2025-11-15 14:25:00'),
-- --- WEEK 8: Nov 17 - Nov 22 ---
(129, '2025-11-17 09:00:00', 1800, 'REQUESTED', 'Pippa Purslane', 'pippa@succulent.net', '5550000090', 'I need help with boundaries. I keep growing out of my designated area and into the expensive flower beds. My "Weed Shame" is triggered every time I see a manicured rose. I need to learn to restrict my growth to acceptable, low-status areas.', NULL, false, '2025-11-16 14:30:00', '2025-11-16 14:30:00'),
(130, '2025-11-17 10:30:00', 1800, 'SCHEDULED', 'The entire Vegetable Kingdom', 'kingdom@earth.org', '5550000100', 'We are rescheduling the cancelled session. We need to address our collective trauma regarding Thanksgiving preparation. The intense pressure, the chopping, the blending... it''s too much. We need a survival strategy for the holidays.', NULL, false, '2025-11-16 14:35:00', '2025-11-16 14:35:00'),
(131, '2025-11-17 11:00:00', 2700, 'COMPLETED', 'Wanda Wasabi', 'wanda@spice.org', '5550000099', 'I postponed to focus on my legal battle. I need to discuss the emotional toll of proving my authenticity. My identity is wrapped up in my pungency, and the stress is dulling my zing. I need a way to restore my Scoville integrity amidst litigation.', 'Patient is exhausted from the legal fight against the horseradish cartel. The stress is inhibiting her natural flavor production. We discussed that true worth is intrinsic and not dependent on court validation. Recommended a full-body abrasive peel (grating) followed by self-soothing affirmations of authenticity.', true, '2025-11-17 14:40:00', '2025-11-17 12:00:00'),
(132, '2025-11-17 14:00:00', 1800, 'SCHEDULED', 'Bertram Bamboo Shoot', 'bertram@shoot.com', '5550000097', 'I have secured a low-roof vehicle for transport! I need to discuss my "Woodiness Phobia" again. I am so afraid of becoming tough. I need a permanent plan to stay tender and edible, avoiding my fate as lumber. Can I be frozen indefinitely?', NULL, false, '2025-11-17 14:45:00', '2025-11-17 14:45:00'),
(133, '2025-11-18 09:30:00', 1800, 'REQUESTED', 'Rita Rutabaga', 'rita@brassica.org', '5550000063', 'I am still confused for a swede! My identity remains dual and blurred. I also hate my thick, waxy skin. I wish I had smooth, delicate skin. I fear my skin is keeping me from finding love and acceptance among the other root vegetables.', NULL, false, '2025-11-17 14:50:00', '2025-11-17 14:50:00'),
(134, '2025-11-18 11:00:00', 1800, 'COMPLETED', 'Danny Dill', 'danny@herb.net', '5550000065', 'I have found a support group of flimsy herbs, but I still crave "Structural Integrity." I feel like a feather in the wind. I need help finding my inner woody herb. I am tired of being associated only with pickles and fleeting freshness.', 'Patient is experiencing "Structural Integrity Envy." We worked on reframing his feathery appearance as "delicacy and grace," rather than weakness. Recommended he spend time near strong, stable objects (like oak trees) to absorb their energy.', true, '2025-11-18 14:55:00', '2025-11-18 11:35:00'),
(135, '2025-11-18 11:30:00', 1800, 'SCHEDULED', 'Gideon Grain (Quinoa)', 'gideon@trendy.net', '5550000086', 'I am back to discuss my fading glory. I fear I am no longer "the" trend. I am seeing rivals gain popularity. My "Celebrity Pseudocereal Syndrome" is threatening to relapse into "Post-Fame Depression." I need reassurance that I am still better than rice.', NULL, false, '2025-11-18 15:00:00', '2025-11-18 15:00:00'),
(136, '2025-11-18 14:00:00', 1800, 'REQUESTED', 'Paul Potato (Fingerling)', 'paul@finger.com', '5550000052', 'I am afraid of my size. I fear being mistaken for a large French fry, which is a life I do not want. I am a potato of substance! I need help asserting my identity as a whole, high-value tuber, even in my elongated, small form.', NULL, false, '2025-11-18 15:05:00', '2025-11-18 15:05:00'),
(137, '2025-11-19 09:00:00', 1800, 'COMPLETED', 'Ricky Radish', 'ricky@root.org', '5550000023', 'I need help managing my aggressive peppery personality. I keep offending the milder root vegetables. My spice is causing social isolation. I want to be able to control my "zing" so I can have gentler conversations with the carrots and parsnips.', 'Patient completed his session on managing his peppery personality.', true, '2025-11-19 15:10:00', '2025-11-19 09:35:00'),
(138, '2025-11-19 11:30:00', 1800, 'SCHEDULED', 'Ezekiel Endive', 'ezekiel@chicory.com', '5550000053', 'I am profoundly bitter, and I am proud of it! But I fear my constant cynicism is driving away the creamy, sweet fillings I secretly crave. I am stuck in a loop of bitterness and craving sweetness. I need to know how to attract goat cheese without compromising my bitter identity.', NULL, false, '2025-11-19 15:15:00', '2025-11-19 15:15:00'),
(139, '2025-11-19 14:00:00', 1800, 'REQUESTED', 'Fungi Freddy (Morel)', 'freddy@mycelium.com', '5550000044', 'I need emergency consultation. I was featured in a dish with button mushrooms! I fear my reputation is ruined! This contamination by common fungi is unacceptable. My "Exclusive Fungi Fear" requires I isolate myself immediately.', NULL, false, '2025-11-19 15:20:00', '2025-11-19 15:20:00'),
(140, '2025-11-20 09:00:00', 1800, 'SCHEDULED', 'Clementine Cucumber', 'c.c@cool.net', '5550000033', 'I am back to discuss my "coolness" as a defense mechanism. I can''t feel genuine emotion because I default to "cool as a cucumber." I want to feel heat, passion, and excitement, but I fear it will lead to wilting. My emotional regulation is too effective.', NULL, false, '2025-11-20 15:25:00', '2025-11-20 15:25:00'),
(141, '2025-11-20 11:30:00', 1800, 'COMPLETED', 'Veronica Vicia Faba (Broad Bean)', 'vici@faba.com', '5550000068', 'I have decided to embrace aging. I accept that I will turn pale and need peeling, but I will gain a nuttier flavor. My "Age-Related Identity Anxiety" is subsiding. Now I need to address "Shelling Stress"—the trauma of being ripped from the pod.', 'Patient completed her session on embracing the aging process.', true, '2025-11-20 15:30:00', '2025-11-20 12:05:00'),
(142, '2025-11-20 14:00:00', 1800, 'SCHEDULED', 'Alvin Allspice', 'alvin@spice.com', '5550000069', 'I am a one-man spice cabinet, and the responsibility is too much. I taste like cinnamon, cloves, and nutmeg all at once! This causes massive identity overload. I don''t know which flavor to lead with. I worry I''m just a "flavor mashup" without a singular identity. I need to simplify my flavor profile!', NULL, false, '2025-11-20 15:35:00', '2025-11-20 15:35:00'),
(143, '2025-11-21 09:00:00', 1800, 'REQUESTED', 'Timmy Taro', 'timmy@rhizome.com', '5550000067', 'I need urgent help! I cut myself, and the oozing of the sliminess was uncontrollable! My "Mucilage Phobia" is at its peak. I felt unclean and messy. I need a medical-grade solution to stop the goo and allow me to feel dry and respectable.', NULL, false, '2025-11-21 15:40:00', '2025-11-21 15:40:00'),
(144, '2025-11-21 11:00:00', 1800, 'NO_SHOW', 'Chandra Chard', 'chandra@swiss.com', '5550000064', 'I am afraid to attend. My stem is too red today, and I fear my conflicting color profile will cause anxiety in the waiting room. I am struggling to integrate my flashy stem and muted leaf. I will not come until I achieve a more uniform, emotionally stable hue.', 'Patient NO_SHOW, citing an inability to achieve a stable emotional hue.', false, '2025-11-21 15:45:00', '2025-11-21 15:45:00'),
(145, '2025-11-21 11:15:00', 2700, 'SCHEDULED', 'Holly Hominy', 'holly@nixtamal.org', '5550000056', 'I am experiencing a flashback of the nixtamalization process. The lye! The heat! I feel my corn-identity slipping away again. I need immediate reassurance that I will not be flattened into a tortilla before the end of the day. The puffiness is increasing.', NULL, false, '2025-11-21 15:50:00', '2025-11-21 15:50:00'),
(146, '2025-11-21 14:00:00', 1800, 'COMPLETED', 'Ingrid Iceberg', 'ingrid@crisp.net', '5550000051', 'I need a consultation about my high-water content. I feel shallow and useless because I lack deep nutritional value. I am a beauty, but a fleeting, watery one. I fear the critics who call me "empty." I need a way to feel substantial.', 'Patient completed her session on high-water content and self-worth.', true, '2025-11-21 15:55:00', '2025-11-21 14:35:00'),
(147, '2025-11-22 09:30:00', 1800, 'REQUESTED', 'Olive Oil Olive', 'olive@olea.com', '5550000088', 'I need an emergency re-sealing session. My new container has a faulty seal, and I am leaking again! I am losing my self-identity drop by drop! I feel like my essential essence is draining away, leaving me as a greasy memory. I need a permanent, high-grade solution.', NULL, false, '2025-11-22 16:00:00', '2025-11-22 16:00:00'),
(148, '2025-11-22 10:00:00', 1800, 'SCHEDULED', 'Gail Gherkin', 'gail@pickles.com', '5550000048', 'My "Crunch Obsession Disorder" is affecting my relationships. I keep questioning my friends'' structural integrity. I need to accept that softness is not failure. I am afraid if I stop obsessing over my crunch, I will go soft and become irrelevant.', NULL, false, '2025-11-22 16:05:00', '2025-11-22 16:05:00'),
(149, '2025-11-24 09:00:00', 1800, 'REQUESTED', 'Ricky Radish', 'ricky@root.org', '5550000023', 'I need help with my image. I am tired of being the "spicy little guy." I want to be known for depth and maturity, not just a quick, peppery burst. I feel like I am perpetually sliced thin and ignored for my true root potential. How do I achieve status?', NULL, false, '2025-11-23 16:10:00', '2025-11-23 16:10:00'),
(150, '2025-11-24 11:30:00', 1800, 'SCHEDULED', 'Bok Choy Bobby', 'bobby@asianleaf.net', '5550000041', 'I am back to discuss my "Vertical Structural Anxiety." I almost fell over yesterday! My leaves are too heavy for my stems. I need a concrete plan to reinforce my central structure before I become a stir-fry casualty. I need to be more "cabbage-like."', NULL, false, '2025-11-23 16:15:00', '2025-11-23 16:15:00'),
(151, '2025-11-24 14:00:00', 1800, 'REQUESTED', 'Professor Pepper (Bell)', 'bell@capsicum.com', '5550000018', 'I am struggling with my "Hollowness Trauma." I was briefly filled with rice and sausage, and the feeling of being a vessel for foreign components was overwhelming. I fear I will never be seen as a whole being, only a brightly colored, crunchy cavity.', NULL, false, '2025-11-24 16:20:00', '2025-11-24 16:20:00'),
(152, '2025-11-25 09:30:00', 1800, 'COMPLETED', 'Spud "Tater" Smith', 'spud@tuber.com', '5550000021', 'I am back to discuss my "Ocular Paradox Anxiety." My eyes are too numerous! I fear I am being watched by my own body. Also, I need to know: if I am mashed, do all my eyes disappear, or do they become a texture problem?', 'Patient completed his session on ocular paradox and mashing anxiety.', true, '2025-11-24 16:25:00', '2025-11-25 10:05:00'),
(153, '2025-11-25 11:00:00', 1800, 'SCHEDULED', 'Harriet Horseradish', 'harriet@root.com', '5550000038', 'I am back to discuss my "Grating Rage Syndrome." I snapped at a piece of mild lettuce! My volatile nature is uncontrollable. I need a way to release my rage without grating myself or offending innocent leafy greens. My whiteness is also a symbol of repressed rage.', NULL, false, '2025-11-25 16:30:00', '2025-11-25 16:30:00'),
(154, '2025-11-25 11:15:00', 2700, 'REQUESTED', 'Cornelius ''Corny'' Corn', 'c.c@husk.org', '5550000008', 'I need an emergency check-in. The temperatures are dropping, and my "Pop Anxiety" is peaking! I am terrified of spontaneous combustion in the cold. I also need follow-up on my GMO-dread. I fear my DNA is secretly plotting against my husk-integrity.', NULL, false, '2025-11-25 16:35:00', '2025-11-25 16:35:00'),
(155, '2025-11-25 14:00:00', 1800, 'SCHEDULED', 'Titus Turnip', 'titus@root.org', '5550000020', 'I am still battling "Potato Envy." I want to be mashed and loved like a potato, but I fear my subtle bitterness will lead to rejection. I am also stuck in a relevance loop, fearing I will never be as popular as a sweet potato. How do I achieve mass appeal?', NULL, false, '2025-11-25 16:40:00', '2025-11-25 16:40:00'),
(156, '2025-11-26 09:00:00', 1800, 'REQUESTED', 'Kiyoko Kai-lan', 'kiyoko@gailan.cn', '5550000029', 'I am tired of the "fusion confusion." People are constantly mistaking me for spinach! I am a Chinese Broccoli! I have a thick, beautiful stem! I need validation that my dense, bitter leaves are superior to soft, watery spinach.', NULL, false, '2025-11-26 16:45:00', '2025-11-26 16:45:00'),
(157, '2025-11-26 11:30:00', 1800, 'SCHEDULED', 'Zane Zucchini', 'zane@gourd.org', '5550000012', 'I am preparing for the winter slump. My "Seasonal Popularity Disorder" is setting in. I need a coping mechanism for the dark months when only winter squash are popular. I fear I will be relegated to the freezer, only to emerge as a bland, watery ghost.', NULL, false, '2025-11-26 16:50:00', '2025-11-26 16:50:00'),
(158, '2025-11-26 14:00:00', 1800, 'COMPLETED', 'Phyllis Pickled Onion', 'phyllis@brine.com', '5550000058', 'I need help managing my relationship with my salt. I feel I am too dependent on the brine for my aggressive personality. If I leave the brine, I soften and lose my vinegar-fueled edge. I am afraid of who I am without the high sodium content.', 'Patient completed her session on Brine Identity Syndrome.', true, '2025-11-26 16:55:00', '2025-11-26 14:35:00'),
(159, '2025-11-27 09:00:00', 1800, 'SCHEDULED', 'Giselle Green Pea', 'giselle@pod.net', '5550000082', 'I am still struggling with my "Preservation Phobia." I fear the sudden darkness of the can and the overwhelming cold of the freezer. I need to accept that preservation is a means of survival, not a permanent death.', NULL, false, '2025-11-27 17:00:00', '2025-11-27 17:00:00'),
(160, '2025-11-27 10:30:00', 2700, 'REQUESTED', 'Zucchini Flower Frank', 'frank@blossom.net', '5550000160', 'I am suffering from immense self-doubt because I am a flower! I am not a real vegetable! I am too delicate and fleeting. I fear being perceived as frivolous and disposable, only useful when stuffed with cheese. I need to find dignity in my short, edible life.', NULL, false, '2025-11-27 17:05:00', '2025-11-27 17:05:00'),
(161, '2025-11-27 11:00:00', 1800, 'COMPLETED', 'Baron Borage', 'baron@flower.com', '5550000059', 'I am back to discuss my confusing identity (blue flower, cucumber taste). I feel like a culinary joke. I need help finding a singular, non-conflicting identity that the human palate can easily process.', 'Patient completed his session on identity confusion.', true, '2025-11-27 17:10:00', '2025-11-27 11:35:00'),
(162, '2025-11-27 14:00:00', 1800, 'SCHEDULED', 'Quinn Quince', 'quinn@fruit.net', '5550000060', 'I am struggling with my "High-Maintenance" identity. I hate that I need hours of boiling and sweetening to be loved. I wish I was easy, like an apple. I need to accept that my raw hardness and acidity are merely the starting point for my complex flavor.', NULL, false, '2025-11-27 17:15:00', '2025-11-27 17:15:00'),
(163, '2025-11-28 09:30:00', 1800, 'REQUESTED', 'Squashy Sheldon', 'sheldon@gourd.org', '5550000050', 'I am worried about my curve again. My "Crookneck Curvature Anxiety" is returning. I saw a picture of a straight zucchini and felt immense shape envy. I need reassurance that my curve doesn''t imply moral instability or poor life choices.', NULL, false, '2025-11-28 17:20:00', '2025-11-28 17:20:00'),
(164, '2025-11-28 11:00:00', 1800, 'SCHEDULED', 'Arturo Arugula', 'arturo@spicy.com', '5550000080', 'I need help managing my "Bolting Catastrophe" fear. I am terrified of growing too large and bitter. I feel stunted because I consciously restrict my growth. I need a healthy relationship with size and bitterness.', NULL, false, '2025-11-28 17:25:00', '2025-11-28 17:25:00'),
(165, '2025-11-28 11:15:00', 3600, 'COMPLETED', 'Olive Oil Olive', 'olive@olea.com', '5550000088', 'I am back to discuss my "Liquefaction Trauma." I need help accepting that I am oil now, not fruit. My primary fear is oxidation in the can. I need a maintenance plan to prevent my new identity from going rancid.', 'Patient completed her session on liquefaction trauma.', true, '2025-11-28 17:30:00', '2025-11-28 12:15:00'),
(166, '2025-11-28 14:00:00', 1800, 'SCHEDULED', 'Prudence Pimiento', 'prudence@capsicum.com', '5550000073', 'I need to discuss my "Vegetable Prosthetic Despair." I fear I am only useful when filling a hole in an olive. I need to find a purpose that allows me to exist as a whole, unsliced pepper, not a surgically altered pit replacement.', NULL, false, '2025-11-28 17:35:00', '2025-11-28 17:35:00'),
(167, '2025-11-29 09:00:00', 1800, 'REQUESTED', 'Red R. Ruby', 'ruby@redroot.org', '5550000045', 'I am back to discuss my "Pretty Onion Performance Anxiety." I am tired of being the colorful, zesty salad onion who still makes people cry. I want to be emotionally honest without causing physiological distress in others.', NULL, false, '2025-11-29 17:40:00', '2025-11-29 17:40:00'),
