(174, '2025-12-02 11:30:00', 1800, 'REQUESTED', 'Celinda Celery', 'c.celery@stalk.com', '5550000011', 'I need an emergency session. My "Vitamixophobia" is back! I saw an infomercial for a high-powered blender and had a complete meltdown. I fear my strings and crunchiness are drawing the attention of destructive forces.', NULL, false, '2025-12-02 18:15:00', '2025-12-02 18:15:00'),
