(176, '2025-12-03 09:30:00', 1800, 'COMPLETED', 'Reggie Rhubarb', 'reggie@stalk.com', '5550000084', 'I need help asserting my savory identity. I am a vegetable, but everyone sees me as a fruit for pie! I want to explore my potential in tarts and savory sauces, not just sugar-laden desserts.', 'Patient completed his session on asserting his savory identity.', true, '2025-12-03 18:25:00', '2025-12-03 10:05:00'),
(177, '2025-12-03 11:00:00', 1800, 'REQUESTED', 'Prudence Pimiento', 'prudence@capsicum.com', '5550000073', 'I am back to discuss my "Vegetable Prosthetic Despair." I need help finding dignity in being a stuffing for olives. I fear I am doomed to exist only as a colorful cavity filler.', NULL, false, '2025-12-03 18:30:00', '2025-12-03 18:30:00'),
(178, '2025-12-03 14:00:00', 1800, 'SCHEDULED', 'Tofu Tina', 'tina@soy.net', '5550000092', 'I need help finding my core flavor! I am tired of being marinated into different personalities. I want to know who Tofu Tina is without the teriyaki or the curry. My "Imposter Protein Syndrome" is crippling.', NULL, false, '2025-12-03 18:35:00', '2025-12-03 18:35:00'),
